import React from 'react'

export default function Scheudle() {
    const [events, setevents] = React.useState([]);
    React.useEffect(() => {
        let url = "https://adonix.hackillinois.org/event/"
        fetch(url)
            .then((response) => response.json())
            .then((data) => {
                setProfiles(data.profiles);
      })
    })
}
